['#include<stdio.h>
#include<stdlib.h>
#include<string.h>


int findMax(int a, int b) {
    if (a >= b) {
        return a;
    }
    else {
        return b;
    }
}


int main() {
    int n, d;
    scanf("%d %d", &n, &d);
    int count, canWin = 0;
    char opponent[d][n];
    int max = 0;
    for(int i = 0; i < d; i++) {
        count = 0;
        scanf("%s", &opponent[i]);
        for(int j = 0; j < n; j++) {
            if(opponent[i][j] == '1') 
                count++;
        }
        if (count != n) {
            canWin++;
            max = findMax(max, canWin);
        }
        else {
            canWin = 0;
            max = findMax(max, canWin);
        }
    }
    printf("%d", max);
}']

['#include<stdio.h>
