#include<string.h>
#include<ctype.h>
int main()
{
    int n,k,i,j,g=0,f=0;
    scanf("%d %d",&n,&k);
    char S[k][n];
    for(i=0;i<k;i++)
    {
        scanf("%s",&S[i]);
        for(j=0;j<n;j++)
        {
            if(S[i][j]=='1')
            {
                continue;
            }
            else
            {
                break;
            }
        }
        if(j==n)
        {
            f=0;
        }
        else
        {
            f++;
        }
        if(f>g)
        {
            g=f;
        }
    }
    printf("%d\n",g);
    return 0;
}
