['#include<stdio.h>
int main()
{
	int n,d,c=0,x=0,i,j,max=0;
	char a;
	scanf("%d %d",&n,&d);
	scanf("%c",&a);
	for(i=1;i<=d;i++)
	{
		for(j=0;j<=n;j++)
		{
			scanf("%c",&a);
			if(a=='0')
				x=1;
		}
		if(x==1)
			c++;
		else
		{
			if(max<c)
				max=c;
			c=0;
		}
		x=0;
	}
	if(max<c)
		max=c;
	printf("%d",max);
	return 0;
}']

