['#include <stdio.h>
#include <stdlib.h>
#include <math.h>
#include <string.h>

int main()
{
    long long int n;
    scanf("%lld",&n);
    char str[256];
    sprintf(str,"%lld",n);
    int t = strlen(str);
    int i = 0;
    int p = pow(10,2);
    long long int myint = 0;
    while(i!=t)
    {
        int p = round(pow(10,t-1-i));
        int k = n / p;
        myint += k*pow(10,2*t-i-1) + k*pow(10,i);
        n = n%p;
        i++;
    }
    printf("%lld",myint);
    return 0;
}
']

