['#include <stdio.h>
#include <string.h>

void reverseString(char arr[], int size);

int main()
{
    char PariNumber[1000000];
    gets(PariNumber);
    printf("%s", PariNumber);

    reverseString(PariNumber, strlen(PariNumber));
    puts(PariNumber);
}

void reverseString(char arr[], int size)
{
    char tempArray[1000000];

    int j=0;
    int i;
    for(i=size-1; i>=0; i--)
    {
        tempArray[j++] = arr[i];
    }
    strcpy(arr, tempArray);
}']

