['#include<stdio.h>
#include<string.h>
void strrev(char *p,long int);
int main()
{    long int i,n;
    char c[1100000],d[1100000];
    scanf("%s",c);

    n=strlen(c);
    for(i=0;i<n;i++)
    {
    d[i]=c[i];
    }
    strrev(c,n);
    printf("%s%s",d,c);
    return 0;
}

strrev(char *p,long int n)
{
int i;
char t;
for(i=0;i<n/2;i++)
{
t=*(p+i);
*(p+i)=*(p+n-1-i);
*(p+n-1-i)=t;
}
}']

