['int main(){
    
    long long n;
    scanf("%lld",&n);
    long long res;
    //calculer le nombre de digit
    int count = 0;
    long long n1 = n;
    while (n1 != 0) {
        n1 = n1 / 10;
        count++;
    }
    //printf("%d\n", count);
    if(count == 1)
        res = n*11;
    else
        //res = (count -1)*11 + pow(10,count)*11;
        res = ((n-pow(10,count-2))*pow(10,count-1)+1+(9*(count-2)*pow(10,count-2)))*11;
        
    printf("%lld\n",res);
    
    return 0;

}
