   word = calloc(100001, sizeof(char));
   scanf("%s", word);
   int len = 0;
   int i;
   while (word[++len]);
   fo(i,0,len-1)
      printf("%c", word[i]);
   of(i,len-1,0)
      printf("%c", word[i]);
   printf("\n");
