{
    int n,d,i,max,count,p=0,j=0;
    char s[110];
    scanf("%d%d",&n,&d);
    int a[110];
    for(i=0;i<=d;i++)
        a[i]=0;

    for(i=0; i<d; i++)
    {
        count=0;
