int ifpal(int n)
{
        int l=0,i,p=n,s=0;
        p=n;
        while(p>0)
        {
                i=p%10;
                s=10*s + i;
                p=p/10;
        }
        if(s==n) return 1;
        else return 0;

}
int nod(int n)
{
        int l=0;
        while(n>0)
        {
                l++;
                n=n/10;
        }
        return l;
}
