    for(i=0;i<d;i++)
    {
        scanf("%s",b);
        for(j=0;j<n;j++)
        {
            if(b[j]=='0')
            {
                a[i]=1;
                break;
            }
            else
            {
                if(j==n-1)
                {
                    a[i]=0;
                }
                else
                {
                    continue;
